function y = call_custom_log(x)
    fm = get_fimath();

    y = fi(replacement_custom_log(x), 0, 16, 14, fm);
end

function y = call_custom_exp(x)
    fm = get_fimath();

    y = fi(replacement_custom_exp(x), 0, 16, 14, fm);
end

function [y] = custom_log(x)
    fm = get_fimath();

    y = fi(log(x), 0, 16, 14, fm);
end

function [y] = custom_exp(x)
    fm = get_fimath();

    y = fi(exp(x), 0, 16, 14, fm);
end



function y = fi_signed(a)
    coder.inline( 'always' );
    if isfi( a ) && ~(issigned( a ))
        nt = numerictype( a );
        new_nt = numerictype( 1, nt.WordLength + 1, nt.FractionLength );
        y = fi( a, new_nt, fimath( a ) );
    else
        y = a;
    end
end


function y = fi_toint(u)
    coder.inline( 'always' );
    if isfi( u )
        nt = numerictype( u );
        s = nt.SignednessBool;
        wl = nt.WordLength;
        y = int32( fi( u, s, wl, 0, hdlfimath ) );
    else
        y = int32( u );
    end
end


function y = fi_uminus(a)
    coder.inline( 'always' );
    if isfi( a )
        nt = numerictype( a );
        new_nt = numerictype( 1, nt.WordLength + 1, nt.FractionLength );
        y = -fi( a, new_nt, fimath( a ) );
    else
        y = -a;
    end
end

